import React from 'react';

import './App.css';
import VideoCard from './VideoCard.js';

function ResultsPage({match}) {
  const information = require('./information.json');
  const item = information[match.params.id-1];

  console.log(item);

  return(
    <body>
        <div id="root">
            <main class="App">
               <div class ="VideoPage">
                   <header>Results Page</header>
                   <div class="video-container">
                   <video autoplay controls>
                       <source src ={require("./videos/" + item.media + ".mp4")} type="video/mp4"/>
                   </video>
                   </div>

                    <div class ="body-container">
                        <h1 class="title"></h1>
                        <p class ="description">description</p>
                            "{item.views}"
                            "{item.uploadDate}"

                                <div class="meta-data">
                                    <div class="left">"ThumbNail"</div>
                                    <div class="right"> 
                                        <h1 class="title">title</h1>
                                        <p class ="description">{item.subscribers}</p>
                                        <p class ="description">{item.description}</p>
                                    </div>
                                </div>

                        <a class="button" href="/">Back to home</a>
                    </div>
               </div>
            </main>
        </div>
    </body>
);
  }

  export default ResultsPage;
